import { VictoryLine } from "victory";

export function DefaultLineChart(props){
    const {border="10px solid #ccc", data=[ { x: 1, y: 2 }, { x: 2, y: 3 }, { x: 3, y: 5 }, { x: 4, y: 4 }, { x: 5, y: 7 } ]} = props

    return (
    <VictoryChart>
        <VictoryLine 
            animate={{
                duration: 2000,
                onLoad: { duration: 2000 }}}
            style={{data: {stroke:props.lineColor, parent: { border:{border}}}}}
            interpolation="natural"
            data={data}/>
    </VictoryChart>)
}
